export default class Footer extends Component {
  render() {
    return (
        <div
          className="text-center justify-center mt-3 text-white"
          style={{ backgroundColor: "#7e0001" }}
        >
          <footer className="footer">
            <div className="pt-2">
              <a href="/">Anjum</a>
              <span>&copy; 2020 creativeLabs.</span>
            </div>
          </footer>
        </div>
    );
  }
}
